    "2013-03-15T23:40:15.846684",nt"name": "washington-active-faults",nt"isopen":
    false,nt"url": null,nt"notes": "The records within this dataset represent
    faults with known or suspected Quaternary (<1,600,000 yrs) activity in the state
    of Washington. These records make up a feature class that is part of a geodatabase
    that contains data on seismogenic features in Washington State. Other feature classes
    are active_fold, earthquake_location, and excavation_trench. Data were gathered
    from numerous sources, including the Washington State portion of the U.S Geological
    Survey's"Quaternary fault and fold database of the United States"(USGS, 2010).
    Faults were attributed with information such as age, visibility, method of detection,
    and in most cases, the corresponding ID number for the fault in the USGS database,
    for easy correlation between the two data sources. This dataset contains multiple
    interpretations of the same faults or fault systems by different authors, which
    may be only partially co-located. Differing interpretations are the result of different
    methods used to detect the faults and the scale of the investigation. Care should
    be used with this dataset to ensure full understanding of the scope of past work
    and breadth of interpretation of the fault of interest.",nt"license_title":
